import React, { useEffect, useState } from "react";
import DefaultLayout from "./../components/DefaultLayout";
import axios from "axios"
import { Col, Row } from 'antd';
import ItemList from "../components/ItemList";

const Homepage = () => {
  const [itemsData,setItemData]=useState([])
  const [selectedCategory,setSelectedCategory]=useState('drinks')
  const categories = [
    {
      name:'drink',
      // imageUrl:"https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.acouplecooks.com%2Fwp-content%2Fuploads%2F2021%2F06%2FStrawberry-Water-006.jpg&tbnid=zPCMVbpmbFmXmM&vet=12ahUKEwigk5SaqKSBAxWfticCHcY8Bu8QMygAegQIARB0..i&imgrefurl=https%3A%2F%2Fwww.acouplecooks.com%2Fhealthy-drinks%2F&docid=CJOpWdsNDfN2NM&w=800&h=1000&q=drink&ved=2ahUKEwigk5SaqKSBAxWfticCHcY8Bu8QMygAegQIARB0"
      imageUrl:"data:image/jpeg;base64,"
    },
    {
      name:"Rice",
      imageUrl:"data:image/jpeg;base64,"
    },
    {
      name:"Noodle",
      imageUrl:"data:image/jpeg;base64,"
    }
  ]
  // useEffect
  useEffect(()=>{
    const getAllItems = async ()=>{
      try {
        const {data}= await axios.get('http://localhost:8080/api/items/get-item')
        setItemData(data);
        console.log(data);
      } catch (error) {
        console.log(error);
      }
    }; 
    getAllItems();
  },[])
  return (
    <DefaultLayout>
      <div className="d-flex">
        {categories.map(category=>(
          <div key={category.name} className={`d-flex category ${selectedCategory===category.name && "category-active"}`}
          onClick={()=> setSelectedCategory(category.name)}>
            <h4>{category.name}</h4>
            <img src={category.imageUrl} alt="" height="60" width="60" />
          </div>
        ))}
      </div>
      <Row>
        {
          itemsData.filter((i)=>i.category===selectedCategory).map((item) => (
            <Col xs={24} lg={6} md={12} sm={6}>
            <ItemList key={item.id} item={item} />
            </Col>
          ))
        }
      </Row>
    </DefaultLayout>
  );
};

export default Homepage;